import React from 'react';

class Reportes extends React.Component{
    render(){
        return(
            <div className="card">
                <div className="container">
                    <h3>Total:</h3>
                    <div className="p-3 mb-2 bg-info text-white">
                        S/.2000
                    </div>
                </div>
               
            </div>
        );
    }
}

export default Reportes;
